export function CalculationProfile(calculation) {
    return { type: "CALCULATION_PROFILE",paylod:calculation }
}
export function AveragePos(calculation) {
    return { type: "AVARAGE_POS",paylod:calculation }
}

export function AverageNeg(calculation) {
    return { type: "AVARAGE_NEG",paylod:calculation }
}
export function AverageUnsup(calculation) {
    return { type: "AVARAGE_UNSUP",paylod:calculation }
}
export function Pnu(calculation) {
    return { type: "PNU",paylod:calculation }
}
